import React from 'react';
import { Link } from "react-router-dom";
import "./Header.css";

const Header = () => {
  return (
    <div className="header">
      <Link to="/" className="title">
      Hobbyists Quiz 
      </Link>
      <hr className="divider" />
    </div>
  );
};

export default Header;
